  const initialPage = (props) => {
    return (
      <div>
        <Welcome myHandler={pageChangeHandler}/>
      </div>
    );
  };

  const [currentPage, setCurrentPage] = useState(initialPage);

  const pageChangeHandler = () => {
    setCurrentPage();
  };

  return currentPage;
};

export default App;
